import React from "react";
import './style.css';

export default function Descricao() {
    return (
        <div className="texto">
            <p>As áreas de ciências de dados, segurança da informação, desenvolvimento mobile, engenharia de software e devops são algumas das mais importantes e em constante evolução no campo da tecnologia. Cada uma dessas áreas tem um conjunto único de habilidades e conhecimentos que são necessários para ser bem-sucedido em sua carreira.</p>
        </div>
    );
}
